import React from 'react';

const LoginForm = () => {
  return (
    <>
      <input
        class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
        type="text"
        placeholder="Login"
      />
      <input
        class="py-2 px-3 w-full border rounded-2xl bg-[#f2f2f2]"
        type="text"
        placeholder="Login"
      />

      <button type="submit" class="btn_log">
        Send
      </button>
    </>
  );
};

export default LoginForm;
